Query a mongodb timeseries collection, and get the time difference between datapoints<p>Let's say we have a MongoDB time-series collection, for now without a meta field.</p>
<pre class="lang-js prettyprint-override"><code>const granularity = &quot;second&quot;;
const expireAfterSeconds = 60 * 60 * 24 * 365;

createCollection(&quot;test&quot;, {
    timeseries: {
        timeField: &quot;_createdAt&quot;,
        //metaField: &quot;metadata&quot;,
        granularity,
    },
    expireAfterSeconds,
});
</code></pre>
<p>We want to know the time between the considered and the previous document.
Since the collection has no meta field, we can not modify the document and add a second timestamp afterward.</p>
<p>We can run the following aggregation pipline:</p>
<pre class="lang-js prettyprint-override"><code>collection(&quot;test&quot;).aggregate([
  {
    $sort: {
      _createdAt: 1
    }
  },
  {
    $lookup: {
      from: &quot;test&quot;,
      let: { current_timestamp: &quot;$_createdAt&quot; },
      pipeline: [
        {
          $match: {
            $expr: {
              $or: [
                { $eq: [&quot;$_createdAt&quot;, &quot;$$current_timestamp&quot;] },
                { $lt: [&quot;$_createdAt&quot;, &quot;$$current_timestamp&quot;] }
              ]
            }
          }
        },
        {
          $sort: {
            _createdAt: -1
          }
        },
        {
          $limit: 2
        }
      ],
      as: &quot;matched_docs&quot;
    }
  },
  {
    $addFields: {
      prev_doc: { $arrayElemAt: [&quot;$matched_docs&quot;, 1] },
    }
  },
  {
    $addFields: {
      _deltaTms: {
        $subtract: [&quot;$_createdAt&quot;, &quot;$prev_doc._createdAt&quot;]
      },
    }
  },
  {
    $project: {
      matched_docs: 0,
      prev_doc: 0,
    }
  }
]).toArray();
</code></pre>
<p>This solution extends the document with the _deltaTms field, which is the time delta between the last document in milliseconds.</p>
<p>I wonder if this is the right solution, it looks slightly overcomplicated.
Would it be more efficient in terms of query speed to add a meta field, and rather modify the last document by adding a timestamp, and using a meta field?</p>

