Mongodb $loopkup: Lookup only those documents which satisfy a condition<p>I have two collections, <code>tasks</code> and <code>users</code>. The <code>users</code> collection has 3 important fields <code>user_id</code>, <code>parent_user_id</code> and <code>details</code>. <code>tasks</code> has <code>user_id</code> field which connects it with <code>users</code>.</p>
<p>The requirement of an API is to attach the relevant <code>users.details</code> with the <code>tasks</code> document and it has to be matched with <code>parent_user_id</code>. For this I am using <code>$lookup</code> to match and put the relevant <code>user_details</code>, but since sometimes the <code>parent_user_id</code> can be different to the <code>user_id</code> I have to use 2 lookups.</p>
<p>The first <code>$lookup</code> attaches the <code>parent_user_id</code> for the <code>user_id</code> in the <code>tasks</code> collection and the next <code>$lookup</code> attaches the <code>details</code> using the extracted <code>parent_user_id</code>.</p>
<p>My current pipeline:</p>
<pre><code>[
{
    '$lookup': {
        'from': 'users', 
        'let': {
            'uid': '$user_id', 
            'pid': '$project_id'
        }, 
        'pipeline': [
            {
                '$match': {
                    '$expr': {
                        '$and': [
                            {
                                '$eq': [
                                    '$project_id', '$$pid'
                                ]
                            }, {
                                '$eq': [
                                    '$user_id', '$$uid'
                                ]
                            }
                        ]
                    }
                }
            }, {
                '$project': {
                    '_id': 0, 
                    'parent_user_id': 1
                }
            }
        ], 
        'as': 'parent_info'
    }
}, {
    '$replaceRoot': {
        'newRoot': {
            '$mergeObjects': [
                {
                    '$arrayElemAt': [
                        '$parent_info', 0
                    ]
                }, '$$ROOT'
            ]
        }
