mongodb / mongoose - join the results from one collection with results from another where their IDs match<p>I'm new to mongo and getting a bit tripped up with the variety of options for $lookup, aggregate, populate, etc. I want to make sure I'm using the best data structure.</p>
<p>I currently have two schemas - one for Urls that get saved, and another for Stats that should get associated with those Urls.</p>
<p>URL Schema:</p>
<pre><code>const UrlSchema = new mongoose.Schema({
  urlId: {
    type: String,
    required: true,
  },
...
</code></pre>
<p>Stat Schema:</p>
<pre><code>const StatSchema = new mongoose.Schema({
  urlRef: { //each urlRef corresponds to a `urlId` inside the UrlSchema
    type: String,
    required: true,
  },
...
</code></pre>
<p>I was trying to just return results of all the urls and their corresponding stats in nodejs by looping through them and adding the stats, but I can tell this is not the appropriate way to do this:</p>
<pre><code>//get the urls
const urls = await Url.find({ userId: userId })

